import React from 'react';
import { format } from 'date-fns';
import TimeRange from '../../components/TimelineSlider/App';
import { selectedInterval, timelineInterval, randomTimes } from './datesSource';

const Split = () => (
  <div>
    <div
      style={{
        width: '80vw',
        /* height: '80vh', */
        margin: '24px auto',
        background: '#fff',
        borderRadius: '20px',
      }}
    >
      캔버스 영역
    </div>
    <div
      style={{
        padding: '16px',
        /* height: '20vh', */
        background: '#fff',
        overflowX: 'scroll',
      }}
    >
      <div className="container">
        <div className="info" style={{ fontSize: '20px' }}>
          {selectedInterval.map((d, i) => (
            <span key={d.getTime()}>{format(d, 'yyyy MM dd, HH:mm')}</span>
          ))}
        </div>

        <TimeRange
          selectedInterval={selectedInterval}
          timelineInterval={timelineInterval}
        />
      </div>
    </div>
  </div>
);

export default Split;
